import React from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faXmark, faStarHalfStroke } from "@fortawesome/free-solid-svg-icons";

import { faStar as emptyStar } from "@fortawesome/free-regular-svg-icons";
import { faStar as filledStar } from "@fortawesome/free-solid-svg-icons";

export default function mapResults() {
  return (
    <div className="map-results">
      <div className="map-results-header">
        <h2>Results</h2>
        <button className="map-results-btn">
          <FontAwesomeIcon icon={faXmark} className="icon" />
        </button>
      </div>
      <div className="map-results-elements">
        <div className="map-result">
          <div className="map-result-name">Happy Moon's Kadikoy</div>
          <div>
            3.5 <FontAwesomeIcon icon={filledStar} />{" "}
            <FontAwesomeIcon icon={filledStar} />{" "}
            <FontAwesomeIcon icon={filledStar} />{" "}
            <FontAwesomeIcon icon={faStarHalfStroke} />
            <FontAwesomeIcon icon={emptyStar} />
            (3,479)
          </div>
          <div>Restaurant</div>
          <div>Open</div>
          <div>More Details</div>
          <div>Photo</div>
        </div>
      </div>
    </div>
  );
}
